import React, { Component } from 'react'
import axios from 'axios'
import Layout from '../Layout'

export default class ContributionList extends Component {
    state={
        contributions: undefined,
    }

    getContributions = async () => {
        const response = await axios.get('http://localhost:3000/api/contribution-list')        
        this.setState({
            contributions: response.data.contributions
        })
    }

    render() {
        const { contributions } = this.state

        return (
            <Layout history={this.props.history}>
            <div>
            {contributions ? centers.map((center, i) => 
                <table className= "box table" key={i}>
                    <tbody>
                        <tr>
                        <td>{center.empresa}</td>
                        <div className="ver-button">
                        <td><Link to={`/center/${center._id}`}>Ver</Link></td>
                        </div>
                        </tr>
                        </tbody>
                        </table>
                ) : <p>Cargando...</p>
            }
            </div>
            </Layout>
        )
    }
}
